detail:
전세계 5개국 45만명 이상 호평한 게임으로 평범한 방탈출 게임과는 다른 차별화된 연출, 기발한 마술 요소, 영화 속의 주인공이 되어 체험하는 스토리로 많은 분들께 사랑받고 있습니다.

연인에게는 서로를 의지하는 시간, 친구들과는 잊지 못할 추억, 동료들과는 팀워크를, 아이들에게 참신한 경험을 선사합니다.

저희 브레이크아웃은 이미 5만명이 넘는 분들이 이용하시고 수천개의 리뷰를 남겨주실 만큼 아낌없는 찬사를 보내주고 계신데요.
에이.. 뭐 다 똑같은 방탈출 아니겠어?
브레이크아웃은 다릅니다.
직접 경험해 보세요.

@홍대 방탈출 카페 네이버 최고평점 4.82/5.0
@4,000개가 넘는 네이버 고객 리뷰와 친구에게 추천하는 믿고 가는 방탈출!
@세계 최초로 롤플레잉을 접목해 캐릭터 선정을 통한 전략 게임
@영화 같은 스토리를 가진 테마, 독특한 퍼즐로 구성! 자물쇠, 단순한 방탈출을 잊어라!
@'팀빌딩', '가족', '친구', '동료', '연인', '재방문'
@'한 번도 안 해본 사람은 있어도, 한 번 만 해본 사람은 없다!'
@브레이크아웃에서 영화속 주인공이 되어 새로운 추억을 만들어 가세요.
@홍대놀거리, 홍대데이트,홍대방탈출, 서울방탈출
